import React from "react";

export default function MapPane() {
  return (
    <iframe
      width="600"
      height="450"
      frameborder="0" style="border:0"
      src="https://www.google.com/maps/embed/v1/PLACE?key=AIzaSyB8gNdm5uw0zkEZhknd0nLiUhbrd8K3kjw&q=40.3487,74.6593" allowfullscreen>
    </iframe>
  );
}
